public boolean equals(Object rhs) {
  if (this == rhs) {
    return true;
  }
  if (rhs == null || getClass() != rhs.getClass()) {
    return false;
  }
  final KeyVersion kv = (KeyVersion) rhs;
  return new EqualsBuilder().
      append(name, kv.name).
      append(versionName, kv.versionName).
      append(material, kv.material).
      isEquals();
}
